import Teoria from './components/Teoria';

import logo from './logo.svg';

import Exercicios from './components/Exercicios';
import Planos from './components/Planos';
import Sobre from './components/Sobre';
import Contato from './components/Contato';

import { BrowserRouter as Router, Route}from 'react-router-dom';
import './App.css';


function App() {
  return (
    <Router>
      <Route path='/' render={(props) => (
        <>
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p className="App"> Studio DaCapo </p>
          </header> 
          <nav>
            <a className = "btm" type="button" href='/Teoria'> Aulas </a>
            <a className = "btm" type="button" href='/plans'> Planos </a>
            <a className = "btm" type="button" href='/Exercicios'> Exerc√≠cios </a>
            <a className = "btm" type="button" href='/contact' > Contato </a>
            <a className = "btm" type="button"href='/about'> Sobre </a>
          </nav>
        </>
      )}/>
      <main>
        <Sobre type="button"/>
        <Contato type="button"/>
        <Planos type="button"/>
        <Exercicios type="button"/>
        <Teoria type="button"/>
      </main>
    </Router>
  );
}

export default App;
